INSERT INTO `blog` VALUES ('24', '', , '2021-04-13 21:11:48.236000', 'java多线程、Java八锁问题详解。8锁即8个关于锁执行顺序的问题。\r\n解决问题前，首先需要明白的是 synchronized 只会锁两样东西，一样是调用的对象，一样是Class', '/images/java-logo.png', '转载', '', '', 'java的八锁问题详述', '2021-04-13 23:47:47.690000', '58', '2', '1');
INSERT INTO `blog` VALUES ('25', '', , '2021-04-14 20:00:12.425000', 'Java中的锁分类\r\n在读很多并发文章中，会提及各种各样锁如公平锁，乐观锁等等，这篇文章介绍各种锁的分类。介绍的内容如下：', '/images/java-logo.png', '转载', '', '', 'java的八种锁', '2021-04-14 20:01:00.357000', '15', '2', '1');
