INSERT INTO `blog` VALUES ('46', '', , '2021-05-07 23:50:02.410000', '这篇文章示范了一些markdown编辑器的基本使用。', '/images/guide.jpg', '原创', '', '', '新手指导', '2021-05-08 00:22:33.905000', '2', '14', '17');
INSERT INTO `blog` VALUES ('47', '', , '2021-05-08 00:38:24.302000', '写过博客或者github上面的文档的，应该知道Markdown语法的重要性，不知道的朋友们也别着急，一篇博客轻松搞定Markdown语法。话说这个语法超级简单，一看就会，不信你点进来看看。', '/images/guide.jpg', '转载', '', '', 'Markdown语法', '2021-05-08 09:09:42.264000', '16', '14', '17');
INSERT INTO `blog` VALUES ('48', '', , '2021-05-08 09:08:50.053000', '我们理解您需要更便捷更高效的工具记录思想，整理笔记、知识，并将其中承载的价值传播给他人，**Cmd Markdown** 是我们给出的答案 —— 我们为记录思想和分享知识提供更专业的工具。 ', '/images/guide.jpg', '原创', '', '', '强大的markdown编辑器', '2021-05-08 09:09:57.546000', '3', '14', '17');

